  return (
    <div
      style={{
        width: "100vw",
        height: "100vh",
        display: "flex",
        flexDirection: "column",
        justifyContent: "space-between",
        padding: 0,
      }}
    >
      <Navbar />
      <Logo />
      <p>Нэвтрэх</p>
      <div>
        <div className=""></div>
        <div className=""></div>
        <div className=""></div>
      </div>

      <Footer />
    </div>
  );
};
export default Login;
